INFORMACOES-ADICIONAIS.DESCRICAO-INFORMACOES-ADICIONAIS:
Curso oferecido pelo Programa Especial de Treinamento - PET - aos alunos do Curso de Engenharia Civil da UFAL em 2000, com as seguintes finalidades:
1- Trazer os alunos à Universidade mesmo durante a greve;
2- Evitar, ou reduzir, evasão e reprovação; 
3- Proporcionar, a esses alunos, atividades relativas ao Curso;
4- Preparar os alunos para um possível encurtamento do calendário;
5- Reforçar os conhecimentos vistos, até a greve, em cálculo e física.

